import React from 'react';
import '../css/navBar.css';
import { Link } from 'react-router-dom';
function NavBar(props) {
    return (
        <div className="navBar">
            <Link className="navItem" to="/transactions">Sign up now</Link>
            <div className="navItem" onclick={()=> props.history.push('/transactions')}> Transactions </div>
            <div className="navBarDivider"> | </div>
            <div className="navItem" onclick={()=> props.history.push('/portfolio')}> Portfolio </div>
        </div>
    );
}

export default NavBar;
